import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="title">
        <h1>Mon Profil Academique</h1>
      </div>
      <div className="searchbar">
        <input className='search' type="search" name="" id="" placeholder='matricule'/>
        <a className="btnGo" href="#">Go</a>
      </div>


    </div>
  );
}

export default App;
